window.bookSummaryJSON = "<i>New York Times</i> best-selling novelist Brian Jacques, creator of the beloved <i>Redwall</i> books and one of the most popular children's authors in the world, delivers the second rousing escapade from his <i>Castaways of the Flying Dutchman</i> series. This time around, the immortal Ben and Ned are high in the Pyrenees Mountains, where they make new allies and fight to save a man from a legendary tribe strong in the black arts."; 
